di-3-zhang-bian-liang-he-shu-ju-lei-xing.body:
3.5 字符串的一些基本操作
3.5.1 字符串的输出

字符串，通过+号连接
printf用法字符串，通过%传值。
字符串，通过$引用

object CharPrint {

  def main(args: Array[String]): Unit = {

    var name: String = "banzhang"
    var age: Int = 18

    // 1 字符串，通过+号连接
    println(name + " " + age)

    // 2 printf用法字符串，通过 % 传值
    printf("name=%s age=%d\n",name,age)

    //3 字符串，通过$引用
    println(s"name=$name age=$age")
  }
}


3.5.2 值类型和字符串类型的转换
object CharPrint {

  def main(args: Array[String]): Unit = {
    var a = "125"
    println(a.toInt)
    println(a.toDouble)
    // println(a.toBoolean) // 抛出异常
    println("true".toBoolean)

  }
}


注意:


把字符串转成数字的时候, 必须保证字符的所有内容相对要转成的数字是合法的才可以. 

