8.2 包
Scala 中包的声明, 命名规则和 Java 完全一样, 在此不再赘述.
只学习下与 Java 不同的地方

8.2.1 包语句
Java 的中的包的声明一般是通过 package x.y.z 来声明.
Scala 不仅仅支持 Java 的这种声明方式, 还支持另外一种更加灵活的方式: 包语句
package com{
  package atguigu{
    class Person{  // com.atguigu.Person

    }
  }
}

package com{
  package atguigu{
    package xx{
      class Person{  // com.atguigu.xx.Person

      }
    }
  }
}


说明:


一个文件中的多个类可以使用不同的包
包的结构将来也和文件夹结构没有必然联系了
如果一个文件的中的所有的类都属于同一个包, 最好使用 Java 提供的顶部标记法, 而实际情况也确实是这样是最普遍的做法.


8.2.2 包对象
在 Java 中, 我们的一些工具函数或者常量需要专门添加到一个所谓的类中. 这种做法主要是 JVM 的限制, 但其实并不是很好的选择.
如果能把这些东西添加到包中是更好的一种选择.
Scala 提供的包对象解决了这个问题
每个包都有一个包对象, 我们需要在类的父包中进行定义, 并且和父包的名字保持一致!

package com.atguigu.day04

package abc {

  object Person {
    def main(args: Array[String]): Unit = {
      val p1 = new Person()
      p1.say()
    }
  }

}

package object abc {
  var A: Int = 3

  def foo() = {
    println("包对象中定义的函数...")
  }
}
package abc {

  class Person {
    def say() = {
