8.2.3 包的可见性
在 Java 中，访问权限分为: public，private，protected和默认。在Scala 中，你可以通过类似的修饰符达到同样的效果。但是使用上有区别。

当方法访问权限为默认时，默认为public访问权限

在 Scala 中没有public关键字，即不能用public显式的修饰属性和方法。

private为私有权限，只在类的内部和伴生对象中可用
关于伴生对象和伴生类的概念, 后面再细说
