protected为受保护权限，Scala 中受保护权限比 Java 中更严格，只能子类访问，同包无法访问。

包访问权限
一般是属性私有了, 可以增加包访问权限, 然后包内的其他类也可以访问到了. 这点体现出来了 Scala 包相比 Java 的灵活性.




