Predef 对象中包含了类型、隐式转换以及在 Scala 中常用的一些方法。
所以，既然已经默认导入，那么无须任何前缀或者导入，就可以直接使用那些方法和隐式转换。
它们太方便了，以至于你开始相信它们是 Scala 的一部分，实际上它们是 Scala 标准库的一部分。
