在 Scala 中，protected 让所修饰的成员仅对自己和派生类可见。对于其他类来说，即使正好和所定义这个类处于同一个包中，也无法访问这些成员。更进一步，派生类在访问 protected 成员的时候，成员的类型也需要一致。
