    println(arr1)

    // 使用 ++= 可以追加任何的集合
    arr1 ++= Array(100, 200, 300)
    println(arr1)

    // 移除最后 2个 元素
    arr1.trimEnd(2)  // 在数组的末尾添加和移除元素是一个高效的操作
