    // 从下标为 2 的位置开始插入 70, 80.  理论上可以插入任意多的元素
    arr1.insert(2, 70, 80)
    println(arr1)

    // 移除元素  : 移除下标为 1 的元素
    arr1.remove(1)
    println(arr1)
    // 从下标为 1 的位置开始移除 3 个元素
    arr1.remove(1, 3)
    println(arr1)

    // 数组缓冲转换成数组:
    val arr: Array[Int] = arr1.toArray

  }
}


