object ControlAbstract {
  def main(args: Array[String]): Unit = {
    // 定义一个可以在线程内执行传入的函数的函数
    def runInThread(foo: () => Unit): Unit = {
      new Thread() {
        override def run(): Unit = foo()
      }.start();
